import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Register from './components/Register';
import Login from './components/Login';
import Home from './components/Home';
import ListImages from './components/ListImages';
import IPWhitelist from './components/IPWhitelist';
import ManageContainers from './components/ManageContainers';
import PrivateRoute from './PrivateRoute';
import React, { useState } from 'react';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  // Function to check authentication status (replace with your logic)
  const checkAuth = () => {
    // Implement your logic to check authentication status here
    return isAuthenticated;
  };

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Register />} />
        <Route path="/login" element={<Login />} />
        <PrivateRoute
          path="/home"
          element={<Home />}
          isAuthenticated={checkAuth()}
        />
        <PrivateRoute
          path="/list_images"
          element={<ListImages />}
          isAuthenticated={checkAuth()}
        />
        <PrivateRoute
          path="/manage_containers"
          element={<ManageContainers />}
          isAuthenticated={checkAuth()}
        />
        <PrivateRoute
          path="/ip_whitelist"
          element={<IPWhitelist />}
          isAuthenticated={checkAuth()}
        />
      </Routes>
    </Router>
  );
}

export default App;
